        socket.on("freehours", (data) => {
                console.log(data)
          })
    },[socket])

    console.log(getmsg)

  return (
    <div className="msgcont">
        {getmsg && getmsg.map((x,i) => (
            <div className="msg">
                <div>
                <p>From: Admin</p>
                <p> Message:{x}</p>
                </div>

                    <ReserveinMsg/>
            </div>

        ))}
    </div>
  )
}

